" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Musculoskeletal complications in diabetes mellitus",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?21/53/22358/contributors\">",
