" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features of multiple sclerosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Features suggestive of multiple sclerosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Relapses and remissions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Onset between ages 15 and 50",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Optic neuritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lhermitte's sign",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Internuclear ophthalmoplegia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fatigue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Uhthoff's phenomenon",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Features not suggestive of multiple sclerosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Steady progression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Onset before age 10 or after age 50",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cortical deficits such as aphasia, apraxia, alexia, neglect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rigidity, sustained dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Convulsions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Early dementia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Deficit developing within minutes",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
