"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F60902&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
