" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Response to thrombopoietin",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 439px; height: 303px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Dose-response of daily subcutaneous injections of PEG-recombinant human megakaryocyte growth and development factor (PEG-rHuMGDF) for 28 days on the peripheral platelet count in baboons. The daily doses were 0.05 (red), 0.10 (blue), 0.50 (black), and 2.50 (green) &micro;g/kg. The peripheral platelet count increased incrementally in a log-linear dose-response manner.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Harker, LA, Marzec, UM, Hunt, P, et al, Blood 1996; 88:511.",
"    </div>",
"   </div>",
